import React from "react";
import { Link, NavLink } from "react-router-dom";

const Navbar = () => {
  return (
    <>
      <div className="contianer-fluid nav_bg">
        <div className="row">
          <div className="col-10 mx-auto">
            <div></div>
          </div>
        </div>
      </div>
    </>
  );
};

export default Navbar;

